import Link from 'next/link';

const Navbar = () => {
    return (
        <nav>
            <style jsx>{`
                ul {
                    list-style: none;
                    display: inline-block;
                }

                li {
                    display: inline;
                }

                a {
                    display:block;
                }
            `}</style>

            <ul>
                <li>
                    <Link href="/">Home</Link>
                </li>
                <li>
                    <a href="https://github.com/reecerussell">Github</a>
                </li>
                <li>
                    <Link to="/Projects">Projects</Link>
                </li>
            </ul>
        </nav>
    );
}

export default Navbar;
